import React, { useState } from 'react';
import { CarouselContens } from '../Components/CarouselContents';
import { CategoryContents } from '../Components/CategoryContents';
import { CardContents } from '../Components/CardContents';

interface Values {
  userName: string;
  emailAddress: string;
  password: string;
}

interface Props {}
const ContentsContainers: React.FC<Props> = () => {
  const [isLoading, setIsLoading] = useState<Boolean>(false);
  const onSubmit = (values: Values) => {
    setIsLoading(true);
    const userData = {
      emailAddress: values.emailAddress,
      password: values.password,
    };

    loginUser(userData);
  };

  return (
    <React.Fragment>
      <CarouselContens
        onSubmit={({ userName, emailAddress, password }) => {
          onSubmit({ userName, emailAddress, password });
        }}
      />
      <CategoryContents />
      <CardContents />
    </React.Fragment>
  );
};

export default ContentsContainers;
